import React, { Component } from 'react'
import './Content.scss'
import FindClassView from './FindClassView';
import FindJasuView from './FindJasuView';
import UserControlView from './UserControlView';
const changeSexId = (sexId) => {
    let sex = 'Nam';
    if (sexId === '2') sex = 'Nữ';
    return sex;
}
const changeVoiceId = (voiceId) => {
    let voice = 'Miền Bắc';
    if (voiceId === '2') voice = 'Miền Trung';
    else if (voiceId === '3') voice = 'Miền Nam';
    return voice
}

const changeLevelId = (levelId) => {
    let level = '';
    if (levelId === '1') level = 'Sinh viên'
    else if (levelId === '2') level = 'Gia sư';
    else if (levelId === '3') level = 'Giáo viên';

    return level;
}
const Content = ({ type, userList, classroomList, user }) => {
    if (type === 'classList') {
        return (
            <div>chuaw cos gif</div>
        )
    }
    else if (type === 'classControl') {
        return(
            <FindClassView classroomList={classroomList}/>
        )
    }
    else if (type === 'jasuList') {
        return (
            <FindJasuView userList={userList}/>
        )
    }
    else if (type === 'userControl') {
        return (
            <UserControlView userList={userList}/>
        )
    }

}
export default Content;
